def aupto(nn):
  ok = [1] + [0 for i in range(nn)]
  for m in range(nn+1):
    if ok[m]:  # from formula
      for i in [2*m, 8*m-5, 8*m+5, 8*m-7, 8*m+7]:
        if 0 <= i <= nn: ok[i] = 1
  return [m for m in range(nn+1) if ok[m]]
